window.bookSummaryJSON = "<p>Welcome to Enchantra. There’s only one rule: Never, ever trust your heart.</p> <p>When Genevieve Grimm’s mother is killed, Genevieve wants answers nobody can give… until she receives an invitation to Enchantra, a cursed palace filled with temptations and illusions.</p> <p>Arrogant and dangerously handsome, Rowin Silver meets her at the door and refuses to let her inside. But Genevieve finds her own way in… And soon realizes her mistake.</p> <p>Enchantra is a twisted labyrinth of marble and thorns, where Rowin’s family are trapped forever in a deadly game. Now, Genevieve must win or die.</p> <p>Rowin offers her a deal. They can compete together… if they convince everyone watching that they’re desperately in love.</p> <p>Genevieve knows she can’t trust Rowin, but she’ll do whatever it takes to survive. As they hunt and hide together, Genevieve tries to ignore the desire burning between them. She absolutely cannot fall for this man. Cannot forget that she’s only pretending to be in love.</p> <p>After all, it was Rowin who taught her Enchantra’s first rule… Never, ever trust your heart.</p> <p>Packed with deadly intrigue and spicy romance, Enchantra will transport you to a world of feisty heroines and morally gray love interests, fake dating, forbidden desire and family secrets. If you love books by Kerri Maniscalco, Carissa Broadbent and Lauren Roberts, prepare to discover your new romantasy obsession.</p>"; 
